import 'dart:io';
import 'package:flutter/material.dart';
import 'package:image_picker/image_picker.dart';
import 'package:flutter_localizations/flutter_localizations.dart';
import 'package:flutter/services.dart';
import 'dart:typed_data';
import 'dart:convert';

import 'PictureDialog.dart';

final double maxWidthInitialProfileImage = 300.0;
final double maxHeightInitialProfileImage = 300.0;
final String cameraSource = 'fromCameraCropImage';
final String gallerySource = 'fromGalleryCropImage';

class PlayingWithImages extends StatefulWidget {
  @override
  _PlayingWithImagesState createState() => _PlayingWithImagesState();
}

class _PlayingWithImagesState extends State<PlayingWithImages> {
  File _file;
  String _picture;

  @override
  void initState(){
    super.initState();

/*
    _file = base64ToMemoryImage(base64Test).then((v) {
      setState(() {
        _file = v;
      });
    });
*/
  }

  @override
  Widget build(BuildContext context) {

    return MaterialApp(
      debugShowCheckedModeBanner: false,
      home: Scaffold(
        appBar: AppBar(
          title: Text('Imagen <-> base64'),
        ),
        body: Container(
          child: Column(
            children: <Widget>[
              _file != null
                  ? Image.file(
                _file,
              )
                  : Icon(
                Icons.image,
                size: 200.0,
                color: Theme.of(context).primaryColor,
              ),
              RaisedButton(
                //onPressed: _startGetPicture,
                onPressed: (){_takePic(ImageSource.camera);},
                child: Text('Obtener imagen'),
              ),
            ],
          ),
        ),
      ),
    );
  }

  void _startGetPicture() async{
/*
    ImageSource source = await _showPictureDialog(context);
    _takePic(source);
*/
    showDialog(context: context,
        builder: (BuildContext context) {
          return AlertDialog(
            content: SingleChildScrollView(
              child: ListBody(
                children: <Widget>[
                  GestureDetector(
                    child: Text('Cámara'),
                    onTap: () { _takePic(ImageSource.camera); },
                  ),
                  Padding(
                    padding: EdgeInsets.all(8.0),
                  ),
                  GestureDetector(
                    child: Text('Galería'),
                    onTap: () { _takePic(ImageSource.gallery); },
                  ),
                ],
              ),
            ),
          );
        });
  }

  Future<ImageSource> _showPictureDialog(BuildContext context) async {
    return showDialog<ImageSource>(
      context: context,
      barrierDismissible: false,
      builder: (BuildContext context) {
        return PictureDialog(text: 'Muestra opciones',);
      },
    );
  }

  void _takePic(ImageSource source){
    ImagePicker.pickImage(
      source: source,
      maxWidth: maxWidthInitialProfileImage,
      maxHeight: maxHeightInitialProfileImage,
    ).then((file) {
      if((file ?? '') != ''){
        setState(() {
          Uint8List bytes = file.readAsBytesSync();
          _picture = base64.encode(bytes);
        });
      }
    });

  }

  Widget getImage(){
    if(_picture == null){
      return Text('');
    } else {
      var bytes = base64.decode(_picture);
      var image = Image.memory(bytes);
      print('width = ${image.width}, height = ${image.height}');
      return image;
    }
  }

}

final String base64Test = '';
final String base64Test2 = '';
